import os
import platform

def get_platform():
    return platform.system()

def get_appdata_location():
    platform_name = get_platform()
    if platform_name == "Windows":
        return os.environ.get('APPDATA')
    elif platform_name == "Darwin":
        return os.path.join(os.path.expanduser('~'), 'Library', 'Application Support')
    elif platform_name == "Linux":
        return os.path.join(os.path.expanduser('~'), '.local', 'share')
    else:
        return None


def get_storage_locations():
    locations = []

    # Browser Storage
    locations.append({"path": os.path.join(os.path.expanduser('~'), '.config', 'chromium', 'Default', 'Local Storage', 'leveldb'), "description": "Chrome Local Storage"})
    locations.append({"path": os.path.join(os.path.expanduser('~'), '.mozilla', 'firefox'), "description": "Firefox Profile Directory (Cookies, LocalStorage, etc.)"})
    locations.append({"path": os.path.join(os.path.expanduser('~'), 'Library', 'Cookies'), "description": "Safari Cookies (macOS)"})

    # Application Data
    appdata_location = get_appdata_location()
    if appdata_location:
        locations.append({"path": appdata_location, "description": "Application Data Directory"})

    # Common File Storage
    locations.append({"path": os.path.expanduser('~'), "description": "User Home Directory (Documents, Downloads, etc.)"})
    locations.append({"path": os.path.join(os.path.expanduser('~'), 'Desktop'), "description": "User Desktop"})

    return locations

storage_locations = get_storage_locations()

return {"potential_storage_locations_T001": storage_locations}

